import logo from '../imgs/Mines_Paris_logo.jpg'

function Header() {
    return (
        <div className='header'>
            <h1>
                Web Scrapping APIs 
            </h1>
            <img 
                alt="Mines Paris logo"
                src={logo}   
                height={150}
            />
            <p> 
                <em>Click on any API to show its definition</em>
            </p>
        </div>
    )
}

export default Header
